import React, {useState} from 'react';
import '../Styles.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios, { all } from 'axios';

// variable to hold URL with Django Asset API
const baseURL = 'http://localhost:8000/portfolio/assets/';

function AllocationList()
{
    const [count, setCount] = useState(0);
    const [strTicker, setTicker] = useState('C')
    const [intShares, setShares] = useState(2)
    const [curPrice, setPrice] = useState(100)
    const [dtmBuyDate, setBuyDate] = useState('2023-11-11')
    const [strAccount, setAccount] = useState('roth_ira')
    const [intUser, setUser] = useState(1)

    React.useEffect(() => {
        axios.post(baseURL, {
            ticker_text: strTicker,
            shares_integer: intShares,
            costbasis_price: curPrice,
            buy_date: dtmBuyDate,
            account: strAccount,
            user: intUser
        });
    }, [count]);

    return (
        <div>
            <label htmlFor={'my-input'}>Enter text: </label>
            <input
            id={'strTicker'}
            type={'strTicker'}
            value={strTicker}
            placeholder={'Ticker'}
            onChange={event => {
                setTicker(event.target.strTicker)
            }}
            />
            <p>Count: {count}</p>
            <button onClick={() => setCount(count + 1)}>Increment</button>        
        </div>
      );
 }


export default AllocationList;
